description:
Aret ar 1547 och en man vid namn Fernando De Gama seglar till Orienten for att finna sin fars mordare. Dar blir han raddad av Maria och de bada blir kara i varandra. Av en viss handelse blir Fernando upptackt av kungen som vill ha honom som en av sina narmsta man. Samtidigt far han reda pa att drottningen i landet vill doda kungen for att hon vill ersatta honom med sin alskare. Mitt i alla dessa handelser far han aven reda pa vem som ar hans fars mordare.......


